$.ajax({
  url: "php/php.php",
  method: 'POST',
  data: {
      runner: "getDatatable"
  },
  success: function(response) {
      console.log(response);
      let records = response.split(["\n"]);
      let buttonHTML = `<td>button</td>`;
      let header = `
      <thead>
          <tr>
              <th>ID_VEHICLE</th>
              <th>ID_BIN</th>
              <th>ADDRESS</th>
              <th>ID_DRIVER</th>
              <th>FULLNAME</th>
              <th>More</th>
          </tr>
      </thead>`;
      document.getElementById("recent-purchases-listing").innerHTML = header;

      for (let i = 0; i < records.length; i++) {
          if (records[i] === "") {
              break;
          }
          // console.log(records[i]);
          // $("#table").html(records[i]);
          let record = records[i].split(["\t"]);
          let bodyHTML = `
          <tbody id="table_body">
              <tr id="table_row">
                  <td id="table_cell">
                      ${record[0]}
                  </td>
              </tr>
          </tbody>`;
          let checkBody = document.getElementById("table_body");
          if (checkBody === null) {
              document.getElementById("recent-purchases-listing").innerHTML += bodyHTML;
              let table_row = document.getElementById("table_row");
              for (let j = 1; j < record.length; j++) {
                  var html = `<td id="table_cell">${record[j]}</td>`;
                  table_row.innerHTML += html;
              }
              table_row.innerHTML += buttonHTML;
          } else {
              let rowHTML = `
              <tr id="table_row">
                  <td id="table_cell">
                      ${record[0]}
                  </td>
              </tr>`;
              checkBody.innerHTML += rowHTML;
              let table_row = checkBody.lastElementChild;
              for (let j = 1; j < record.length; j++) {
                  var html = `<td id="table_cell">${record[j]}</td>`;
                  // console.log(record[j]);
                  table_row.innerHTML += html;

              }
              table_row.innerHTML += buttonHTML;
          }

      }
  }
});
});
